CREATE DATABASE `address_analysis` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `address`;
CREATE TABLE `address` (
    `address` VARCHAR(50)  NOT NULL COMMENT '初始化地址',
    `name` VARCHAR(50)  DEFAULT NULL COMMENT '地址名称',
    `account_balance` DECIMAL(65,0) DEFAULT NULL COMMENT '余额账户',
    `account_balance_bn` BIGINT(20) DEFAULT NULL COMMENT '余额账户最后更新块高',
    `account_balance_bt` TIMESTAMP DEFAULT NULL COMMENT  '余额账户最后更新时间',
    `account_restricting` DECIMAL(65,0) DEFAULT NULL COMMENT '锁仓账户',
    `account_restricting_bn` BIGINT(20) DEFAULT NULL COMMENT '锁仓账户最后更新块高',
    `account_restricting_bt` TIMESTAMP DEFAULT NULL COMMENT  '锁仓账户最后更新时间',
    `account_del` DECIMAL(65,0) DEFAULT NULL COMMENT '委托账户',
    `account_del_bn` BIGINT(20) DEFAULT NULL COMMENT '委托账户最后更新块高',
    `account_del_bt` TIMESTAMP DEFAULT NULL COMMENT  '委托账户最后更新时间',
    `account_del_freeze` DECIMAL(65,0) DEFAULT NULL COMMENT '冻结的委托账户',
    `account_del_freeze_bn` BIGINT(20) DEFAULT NULL COMMENT '冻结的委托账户最后更新块高',
    `account_del_freeze_bt` TIMESTAMP DEFAULT NULL COMMENT  '冻结的委托账户最后更新时间',
    `account_del_reward` DECIMAL(65,0) DEFAULT NULL COMMENT '委托奖励账户',
    `account_del_reward_bn` BIGINT(20) DEFAULT NULL COMMENT '委托奖励账户最后更新块高',
    `account_del_reward_bt` TIMESTAMP DEFAULT NULL COMMENT  '委托奖励账户最后更新时间',
    `account_staking` DECIMAL(65,0) DEFAULT NULL COMMENT '质押账户',
    `account_staking_bn` BIGINT(20) DEFAULT NULL COMMENT '质押账户最后更新块高',
    `account_staking_bt` TIMESTAMP DEFAULT NULL COMMENT  '质押账户最后更新时间',
    `account_staking_freeze` DECIMAL(65,0) DEFAULT NULL COMMENT '质押账户',
    `account_staking_freeze_bn` BIGINT(20) DEFAULT NULL COMMENT '质押账户最后更新块高',
    `account_staking_freeze_bt` TIMESTAMP DEFAULT NULL COMMENT  '质押账户最后更新时间',
    `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`address`) USING BTREE
) ENGINE=InnoDB COMMENT='地址表';

DROP TABLE IF EXISTS `account_record`;
CREATE TABLE `account_record` (
    `id` BIGINT(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
    `type` INT(11) NOT NULL COMMENT '记录关联账户类型 0-余额账户 1-锁仓账户 2-委托账户 3-冻结的委托账户 4-委托奖励账户 5-质押账户 6-冻结的质押账户',
    `block_number` BIGINT(20) DEFAULT NULL,
    `block_timestamp` DATETIME DEFAULT NULL COMMENT '区块时间',
    `tx_hash` VARCHAR(128) DEFAULT NULL COMMENT '交易哈希',
    `tx_from` VARCHAR(128)  DEFAULT NULL COMMENT '转账发起者',
    `tx_to` VARCHAR(128) DEFAULT NULL COMMENT '转账接收者',
    `value` VARCHAR(64) DEFAULT NULL COMMENT '交易金额',
    `extra` JSON DEFAULT NULL COMMENT '补充数据',
    `sync_table` VARCHAR(64) NOT NULL COMMENT '从跟踪系统那个表同步',
    `sync_id` BIGINT(20) NOT NULL COMMENT '从跟踪系统指定表的那个id同步',
    `create_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`),
    KEY `block_number` (`block_number`)
) ENGINE=InnoDB COMMENT='账户记录明细';

DROP TABLE IF EXISTS `group`;
CREATE TABLE `group` (
    `id` INT(11) NOT NULL AUTO_INCREMENT,
    `name` VARCHAR(50)  DEFAULT NULL COMMENT '组名称',
    `create_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB COMMENT='大户表';

DROP TABLE IF EXISTS `group_address`;
CREATE TABLE `group_address` (
    `id` INT(11) NOT NULL AUTO_INCREMENT, #从10开始，1-9保留兼容已有的fmis_asset_group的初始化数据
    `group_id` INT(11) NOT NULL COMMENT '初始化地址',
    `address` VARCHAR(50) NOT NULL COMMENT '地址',
    `type` INT(11) NOT NULL DEFAULT 1 COMMENT '地址类型 0-初始地址 1-关联地址',
    `create_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB COMMENT='大户与地址关系表' AUTO_INCREMENT = 10;

DROP TABLE IF EXISTS `group_address_filter`;
CREATE TABLE `group_address_filter` (
    `address` varchar(50)  NOT NULL COMMENT '过滤的地址',
    `name` VARCHAR(50)  DEFAULT NULL COMMENT '地址名称',
    `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`address`) USING BTREE
) ENGINE=InnoDB COMMENT='大户地址过滤表';


DROP TABLE IF EXISTS `node`;
CREATE TABLE `node` (
    `node_id` VARCHAR(130)  NOT NULL COMMENT '节点表',
    `node_name` VARCHAR(130)  NOT NULL COMMENT '节点名称',
    `create_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`node_id`) USING BTREE
) ENGINE=InnoDB COMMENT='节点表';

DROP TABLE IF EXISTS `node_address`;
CREATE TABLE `node_address` (
    `id` INT(11) NOT NULL AUTO_INCREMENT,
    `node_id` VARCHAR(130) NOT NULL COMMENT '初始化地址',
    `address` VARCHAR(50) NOT NULL COMMENT '地址',
    `type` INT(11) NOT NULL DEFAULT 1 COMMENT '地址类型  0-质押地址  1-收益地址',
    `create_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB COMMENT='节点与地址关系表';










